9673479], [128.73589281464882, 38.01968013367355]]], [[[128.73483525590774, 38.01843606873918], [128.73459457986223, 38.018439504697824], [128.7347545438554, 38.018625934161655], [128.73483525590774, 38.01843606873918]]], [[[128.73519343610462, 38.00397968027337], [128.73536651342278, 38.00414617464136], [128.73540316625767, 38.00398815521817], [128.73519343610462, 38.00397968027337]]], [[[128.7355324705828, 38.00384437268952], [128.7355336050162, 38.0040913623514], [128.7359510713679, 38.003865850679865], [128.7355324705828, 38.00384437268952]]], [[[128.74254608880184, 38.00626412145004], [128.74287949348647, 38.007762939705216], [128.74413048178658, 38.00680245767328], [128.74254608880184, 38.00626412145004]]], [[[128.73707520284057, 38.00216004182176], [128.73675193493585, 38.00227046996225], [128.7372455594884, 38.00231371627835], [128.73707520284057, 38.00216004182176]]], [[[128.73924410190978, 38.00101212667732], [128.73888022980222, 38.001145146298484], [128.73900843760072, 38.001241767929194], [128.73924410190978, 38.00101212667732]]], [[[128.74567628574803, 37.99238458163487], [128.7454790908654, 37.992460163259324], [128.74556610372136, 37.992560372957044], [128.74567628574803, 37.99238458163487]]], [[[128.7656262575067, 37.964855914221886], [128.76546914539722, 37.96524429461639], [128.76572942939205, 37.96511123629508], [128.7656262575067, 37.964855914221886]]], [[[128.76998017013855, 37.96039108562988], [128.76978116344816, 37.96052076961007], [128.7699542456958, 37.960518840086756], [128.76998017013855, 37.96039108562988]]], [[[128.7696375785074, 37.95748910136164], [128.76930321995167, 37.95773037688203], [128.76935667193848, 37.957771735833695], [128.7696375785074, 37.95748910136164]]], [[[128.786563073892, 37.94647903284084], [128.78618271672647, 37.94729484945297], [128.78681083230373, 37.946599290793095], [128.786563073892, 37.94647903284084]]], [[[128.7891155500942, 37.945166185294184], [128.78904794735075, 37.94543163922543], [128.78915121314924, 37.945392545134666], [128.7891155500942, 37.945166185294184]]], [[[128.78971088350647, 37.935375939477986], [128.7894775145626, 37.93549288345882], [128.78960679348464, 37.93552485614781], [128.78971088350647, 37.935375939477986]]], [[[128.76506163592077, 37.97217323295867], [128.7647644128995, 37.97223327638405], [128.76506627251263, 37.972327922083124], [128.76506163592077, 37.97217323295867]]]] } }] };

        const width = 500;
        const height = 600;
        const CAP_NUM = 2500000;

        const xCoords = Array.from({ length: width }, (_, i) => 124.5 + i * 0.013);
        const yCoords = Array.from({ length: height }, (_, i) => 38.9 - i * 0.009833333333333331);

        // --- 2. Helper Functions ---

        function build3DSurface(date) {
            const levels = levelsData[date];
            if (!levels) return null;

            const z = [];
            let idx = 0;
            for (let r = 0; r < height; r++) {
                const row = new Float32Array(width);
                for (let c = 0; c < width; c++) {
                    const val = baseGrid[idx];
                    idx++;
                    if (val === -1) {
                        row[c] = NaN;
                    } else if (val === -2) {
                        row[c] = 0;
                    } else {
                        row[c] = levels[val];
                    }
                }
                z.push(row);
            }
            return z;
        }

        function get2DViewDetails(date) {
            const vals = rawData[date];
            let dailyMax = 0;
            for (let v of vals) if (v > dailyMax) dailyMax = v;
            const viewMax = (dailyMax > CAP_NUM) ? CAP_NUM : (dailyMax > 0 ? dailyMax : 1);
            const text = regions.map((r, i) => `${r}: ${vals[i]}`);
            return { z: vals, zmax: viewMax, text: text };
        }

        // --- 3. Initial Render Prep ---
        const initDate = dates[dates.length - 1];

        // Trace 0: 3D Surface
        const z3d = build3DSurface(initDate);
        const trace3d = {
            type: 'surface',
            z: z3d,
            x: xCoords,
            y: yCoords,
            colorscale: [
                [0, "#6bb5ff"],
                [0.4, "#b590b5"],
                [1.0, "#ff6b6b"]
            ],
            cmin: 0, cmax: 15,
            showscale: false,
            contours: { z: { show: false, project: { z: true } } },
            lighting: { ambient: 0.6, roughness: 0.1, diffuse: 0.8, fresnel: 0.2, specular: 0.5 },
            visible: true,
            name: '3D'
        };

        // Trace 1: 2D Choropleth
        const d2 = get2DViewDetails(initDate);
        const trace2d = {
            type: 'choropleth',
            locations: regions,
            z: d2.z,
            geojson: geojson,
            featureidkey: 'properties.CTP_ENG_NM',
            colorscale: 'Reds',
            zmin: 0, zmax: d2.zmax,
            text: d2.text,
            hovertemplate: '%{text}<extra></extra>',
            visible: false,
            name: '2D'
        };

        // Sliders config
        const steps = dates.map(d => ({
            label: d,
            method: 'skip', // Hijack in JS
            args: [],
            execute: false
        }));

        // Layout
        const layout = {
            title: `COVID-19 Confirmed Cases - ${initDate}`,
            autosize: true,
            margin: { l: 0, r: 0, b: 0, t: 50 },
            scene: { // 3D Scene
                xaxis: { visible: false },
                yaxis: { visible: false },
                zaxis: { title: 'Level', visible: false },
                aspectmode: 'manual',
                aspectratio: { x: 1, y: 1.85, z: 0.5 },
                camera: { eye: { x: 1.5, y: -1.5, z: 0.8 } }
            },
            geo: { // 2D Geo
                fitbounds: 'locations',
                visible: false,
                projection: { type: 'mercator' }
            },
            coloraxis: { // Shared if needed, but we used trace specific
                cmin: 0,
                colorbar: { len: 0.8, title: 'Cases' }
            },
            updatemenus: [{
                type: 'buttons',
                direction: 'left',
                pad: { 'r': 10, 't': 10 },
                showactive: true,
                x: 0, y: 1.1, xanchor: 'left', yanchor: 'top',
                buttons: [
                    {
                        label: '3D Confirmed',
                        method: 'update',
                        args: [{ 'visible': [true, false] }, { 'scene.visible': true, 'geo.visible': false }]
                    },
                    {
                        label: '2D Confirmed',
                        method: 'update',
                        args: [{ 'visible': [false, true] }, { 'scene.visible': false, 'geo.visible': true }]
                    }
                ]
            }],
            sliders: [{
                active: dates.length - 1,
                currentvalue: { prefix: "Date: " },
                pad: { t: 50 },
                len: 0.6,
                x: 0.2,
                steps: steps
            }]
        };

        Plotly.newPlot('plotly-div', [trace3d, trace2d], layout).then(() => {
            document.getElementById('loading').style.display = 'none';
        });

        // --- 4. Event Handling ---
        const plotDiv = document.getElementById('plotly-div');

        plotDiv.on('plotly_sliderchange', function (e) {
            const date = e.step.label;

            // Generate Data
            const newZ3d = build3DSurface(date);
            const d2 = get2DViewDetails(date);

            // Update Data Only (Restyle) - Does not change visibility
            Plotly.restyle('plotly-div', {
                z: [newZ3d, d2.z],
                text: [null, d2.text], // Only map needs text
                zmax: [null, d2.zmax]  // Only map needs zmax update
            }, [0, 1]);

            // Update Title
            Plotly.relayout('plotly-div', { title: `COVID-19 Confirmed Cases - ${date}` });
        });

        window.addEventListener('resize', () => {
            Plotly.Plots.resize(plotDiv);
        });

    </script>
